import{_ as t,a as e,b as o,c as a}from"./chunks/img_6.01f9fb90.js";import{_ as r,a as i}from"./chunks/img_8.b292e945.js";import{_ as s,o as n,c,O as l}from"./chunks/framework.4afe7240.js";const g="/assets/img_4.7451845f.png",d="/assets/img_5.0cc281b4.png",H=JSON.parse('{"title":"快速开始","description":"","frontmatter":{},"headers":[{"level":2,"title":"创建 GitHub Token","slug":"创建-github-token","link":"#创建-github-token","children":[]},{"level":2,"title":"配置图床","slug":"配置图床","link":"#配置图床","children":[]},{"level":2,"title":"上传图片","slug":"上传图片","link":"#上传图片","children":[]},{"level":2,"title":"视频教程","slug":"视频教程","link":"#视频教程","children":[]}],"relativePath":"usage-guide/get-start.md","filePath":"usage-guide/get-start.md","lastUpdated":1686217894000}'),p={name:"usage-guide/get-start.md"},h=l('<h1 id="快速开始" tabindex="-1">快速开始 <a class="header-anchor" href="#快速开始" aria-label="Permalink to &quot;快速开始&quot;">​</a></h1><h2 id="创建-github-token" tabindex="-1">创建 GitHub Token <a class="header-anchor" href="#创建-github-token" aria-label="Permalink to &quot;创建 GitHub Token&quot;">​</a></h2><p>PicX 的图床服务依赖 GitHub Token，在开始使用之前，你必须先 <strong><a href="https://github.com/settings/tokens/new" target="_blank" rel="noreferrer">创建</a></strong> 一个带有 <code>repo</code> 权限的 GitHub Token。</p><blockquote><p>点击 <a href="https://github.com/settings/tokens/new" target="_blank" rel="noreferrer">https://github.com/settings/tokens/new</a> 快速新建 GitHub Token</p></blockquote><p><img src="'+t+'" alt="image"></p><p>点击 <strong><code>Generate token</code></strong> 按钮，生成 GitHub Token。</p><p><img src="'+e+'" alt="image"></p><p><img src="'+o+'" alt="image"></p><div class="danger custom-block"><p class="custom-block-title">注意</p><p><strong>新生成的 Token 只会显示一次，请妥善保存，如有遗失，重新生成即可。</strong></p></div><br><h2 id="配置图床" tabindex="-1">配置图床 <a class="header-anchor" href="#配置图床" aria-label="Permalink to &quot;配置图床&quot;">​</a></h2><h3 id="一键自动配置" tabindex="-1">一键自动配置 <a class="header-anchor" href="#一键自动配置" aria-label="Permalink to &quot;一键自动配置&quot;">​</a></h3><p>填写 GitHub Token，点击 <strong><code>一键自动配置</code></strong> 按钮会自动创建 GitHub 仓库，并完成仓库、分支和目录之间的绑定。</p><blockquote><ul><li>自动创建仓库：<code>picx-images-hosting</code></li><li>自动创建分支：<code>master</code></li><li>自动创建目录：<code>yyyyMMdd</code> (当天日期，例如：<code>20230403</code>)</li></ul></blockquote><p><strong>如果你是第一次使用 PicX，那么推荐使用一键自动配置，非常方便</strong>。当然你也可以随时切换成手动配置。</p><p><img src="'+g+'" alt="image"></p><h3 id="手动配置" tabindex="-1">手动配置 <a class="header-anchor" href="#手动配置" aria-label="Permalink to &quot;手动配置&quot;">​</a></h3><p>对于 PicX 的老用户，或者你准备使用一个已有的 GitHub 仓库做图床，使用手动配置更为灵活。</p><p><img src="'+d+'" alt="image"></p><p>手动配置的详细教程请参考 -&gt; <a href="/usage-guide/config.html">图床配置</a></p><br><h2 id="上传图片" tabindex="-1">上传图片 <a class="header-anchor" href="#上传图片" aria-label="Permalink to &quot;上传图片&quot;">​</a></h2><h3 id="选择图片" tabindex="-1">选择图片 <a class="header-anchor" href="#选择图片" aria-label="Permalink to &quot;选择图片&quot;">​</a></h3><ul><li><p>可以通过 <strong>拖拽图片</strong> 到上传区域进行上传。</p></li><li><p>可以通过 <strong>复制图片</strong>，然后 <strong>粘贴</strong> 到上传区域进行上传。</p><blockquote><p>粘贴图片快捷键 <strong><code>Ctrl + V</code></strong> 或 <strong><code>Command + V</code></strong></p></blockquote></li><li><p>可以通过点击上传区域，通过 <strong>选择文件</strong> 的方式选择需要上传的图片。</p></li></ul><p><img src="'+a+'" alt="image"></p><h3 id="上传图片-1" tabindex="-1">上传图片 <a class="header-anchor" href="#上传图片-1" aria-label="Permalink to &quot;上传图片&quot;">​</a></h3><p>点击 <strong><code>上传</code></strong> 按钮或使用 PicX 提供的快捷键 <strong><code>Ctrl + S</code></strong> 或 <strong><code>Command + S</code></strong> 进行上传图片。</p><p><img src="'+r+'" alt="image"></p><h3 id="复制图片链接" tabindex="-1">复制图片链接 <a class="header-anchor" href="#复制图片链接" aria-label="Permalink to &quot;复制图片链接&quot;">​</a></h3><p>图片上传成功后，PicX 会自动复制图片链接到系统剪贴板，你也可以手动点击 <strong><code>复制图片链接</code></strong> ，然后通过快捷键 <strong><code>Ctrl + V</code></strong> 或 <strong><code>Command + V</code></strong> 粘贴使用。</p><p><img src="'+i+'" alt="image"></p><h2 id="视频教程" tabindex="-1">视频教程 <a class="header-anchor" href="#视频教程" aria-label="Permalink to &quot;视频教程&quot;">​</a></h2><p>观看下方 GIF 动图，20 秒学会使用 PicX。</p><p><img src="https://cdn.staticaly.com/gh/XPoet/image-hosting@master/projects/picx/picx-quick-start.2xb6c85xibc0.gif" alt="picx-quick-start"></p>',34),u=[h];function m(b,_,k,f,q,P){return n(),c("div",null,u)}const v=s(p,[["render",m]]);export{H as __pageData,v as default};
